import React from 'react';
import '../styles/Series.css';

export default function BCSCard(props) {
    console.log(props.CSS)
    return (
        <div id="temporada">
            <h2> Temporada { props.value } </h2>
            <h4>  Episodio { props.CPS[1]['title'] } </h4>
        </div>
    );
}
